const subListReducer = (state = { subcriptions: [] }, action) => {
    switch (action.type) {
        case 'SUB_LIST_REQUEST':
            return { loading: true, subcriptions: [] }

        case 'SUBLIST_SUCCESS':
            return {
                loading: false,
                subcriptions: action.payload.subcriptions,
                page: action.payload.page,
                pages: action.payload.pages
            }

        case 'SUB_LIST_FAIL':
            return { loading: false, error: action.payload }

        default:
            return state
    }
}

export default subListReducer
